package com.EsportLeagueStats.ESLS.web.requests;public class AddSezonaRequest {    private String pocetenDatum;    private String kraenDatum;    public AddSezonaRequest(){}    public AddSezonaRequest(String pocetenDatum, String kraenDatum) {        this.pocetenDatum = pocetenDatum;        this.kraenDatum = kraenDatum;    }    public String getPocetenDatum() {        return pocetenDatum;    }    public void setPocetenDatum(String pocetenDatum) {        this.pocetenDatum = pocetenDatum;    }    public String getKraenDatum() {        return kraenDatum;    }    public void setKraenDatum(String kraenDatum) {        this.kraenDatum = kraenDatum;    }}